import React from "react";
import Ndata from "./Ndata";
import Naat from "./Naat";

function ncard(val) {
  return (
    <Naat
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
}

function Naveed() {
  return <>{Ndata.map(ncard)}</>;
}

export default Naveed;
